import image from "../image.png";
import { Link } from 'react-router-dom';

function Logar(){

    return(
    <div>
        <div style={{background:"#2B2B31", height:66, width: "100%", boxShadow: "0px 4px 4px 0px black"}}></div>

        <center>
        <img src={image} style={{
            width:100,
            height: 100,
            marginTop: "5%",
        }}></img>

        <form>
            <input type="text"></input>
            <input type="text"></input>
        </form>

        </center>
    </div>
    );
}

export default Logar;
